import React, { Component } from 'react';

class SignupComponent extends Component{
    constructor(props){
        super(props);
        this.state={
            firstname:"",
            lastname:"",
            email:"",
            password:"",
        }

        this.handleSubmit.bind(this);
    }
    handleSubmit(){
        this.props.handleParent(this.state.title,this.state.content);
        this.state.firstname="";
        this.state.lastname="";
        this.state.email="";
        this.state.password="";
    }

    render() {
        return (
            <div>

                <div id="signup">
                    <input type="text" id="first" placeholder="First Name" /><br/>
                    <input type="text" id="last" placeholder="Last Name" /><br/>
                    <input type="email" id="email" placeholder="Email" /><br/>
                    <input type="password" id="password" placeholder="Password" /><br/>
                    <button  onClick={this.handleSubmit} id="send">Sign Up</button>
                </div>
            </div>

        )
    }
}

export default SignupComponent
